<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<link href="https://fonts.googleapis.com/css?family=Rubik:300,400,500,700&display=swap" rel="stylesheet">
	<title>COVID-19 in Ukraine</title>
	<meta property="og:title" content="COVID-19 in Ukraine" />
	<meta property="og:description" content="Map that shows spread of coronavirus disease in Ukraine" />
	<meta property="og:image" content="http://wyrax.ho.ua/cv/img/map-ukraine-screen.jpg" />

<script src="https://kit.fontawesome.com/17cebd8c49.js" crossorigin="anonymous"></script>
<script	src="https://unpkg.com/tablefilter@latest/dist/tablefilter/tablefilter.js"></script>
<style>

#map-wrapper {
	position: relative;
	width: 70%; /* 100 */
	align-items: center;
}
#map-Ukraine {
	width: 100%;
	height: auto;
	fill: #dddddd;
}
svg g g:hover {
	fill: #333333;
	opacity: 1;
}
.st2 { /* Dnipro-river */
	fill: none;
}
.st3 { /* ORDLO line */
	fill: none;
	stroke:#FFFFFF;
	stroke-width: 2;
	stroke-miterlimit: 10;
}
.st4 { /* regional borders */
	fill: none;
	stroke: #FFFFFF;
	stroke-width: 2;
	stroke-linecap: round;
}
.st5 { /* external frontier */
	fill: none;
	stroke: #CCCCCC;
	stroke-width: 12;
}
.st7 { /* city dot */
	stroke: black;
	stroke-width: 12;
	opacity: .5;
	stroke-opacity: .5;
}
.st8 {
	fill: black;
	font-family: Rubik, sans-serif;
	font-size: 340px;
}
.total-light {
	font-family: Rubik, sans-serif;
	font-size: 290px;
	font-weight: 100;
}
#Kyiv-city {
	stroke: white;
	stroke-width: 5;
}
#Crimea {
	/* fill: #c9b1bb; */
}
#ORDLO {
	/* fill: #c9b1bb; */
}
.occupied {
	fill: #c9b1bb;
}
.UAT-gray {
	fill: #B4B0A8;
}
.UAT-red {
	fill: #E30613;
}
.UAT-black {
	fill: #000000;
}
svg {
	max-width: 100%; /*!important;*/
	height: auto;
	display: block;
}
.div-font-Rubik {
	font-family: Rubik, sans-serif;
	font-size: 14px;
}
#locale-updated {
	display: inline-block;
}
#covid19-Ukraine-update {
	font-family: Rubik, sans-serif;
	font-size: 12px;
	font-weight: bold;
}
.legend {
	left: 20px;
	font-family: Rubik, sans-serif;
	font-size: 14px;
	font-weight: 400;
	margin-right: 30px;
	vertical-align: top;
	display: inline-block;
}
.legend-square {
	height: 14px;
	width: 14px;
	margin-right: 4px;
	display: inline-block;
}
.legend-circle {
	width: 12px;
	height: 12px;
	border-radius: 50%;
	margin-right: 4px;
	display: inline-block;
}
#tooltip {
	pointer-events: none;
	position: absolute;
	text-align: left;
	line-height: 1.2;
	background: #f0f0f0;
	max-width: 12em;
	padding: 3px 5px 5px 5px;
	z-index: 5;
	margin: 0 auto;
	border-radius: 5px;
	box-shadow: 0 0 0 2px #ffffff;
	-moz-transform: translateX(-50%);
	-ms-transform: translateX(-50%);
	-webkit-transform: translateX(-50%);
	transform: translateX(-50%);
	display: none;
}
#tooltip.active {
	display: block;
}
#country-name {
	font-family: Rubik, sans-serif;
	font-size: 14px;
	font-weight: 500;
}
#info-div {
	margin-top: 5px;
	font-family: Rubik, sans-serif;
	font-size: 17px;
	font-weight: 300;
}
.svgicon {
	width: auto;
	height: 14px;
	margin-right: 5px;
	display: inline-block;
}
.legend-svgicon {
	width: auto;
	height: 14px;
	margin-right: 5px;
	display: inline-block;
}
.table-svgicon {
	width: 20px;
	display: inline-block;
}
.virus-suspect {
	fill: #f9e49a;
	background-color: #f9e49a;
}
.virus-suspect-1-9 {
	fill: #f8efcb;
	background-color: #f8efcb;
}
.virus-suspect-10-99 {
	fill: #f9e49a;
	background-color: #f9e49a;
}
.virus-suspect-100-999 {
	fill: #e2c413;
	background-color: #e2c413;
}
.virus-origin {
	fill: #660000;
	background-color: #660000;
}
.virus-spread {
	fill: crimson;
	background-color: crimson;
}
.virus-spread-1-9 {
	fill: #ff9999;
	background-color: #ff9999;
}
.virus-spread-10-99 {
	fill: #ff6666;
	background-color: #ff6666;
}
.virus-spread-100-999 {
	fill: #cc3333;
	background-color: #cc3333;
}
.virus-spread-1000-9999 {
	fill: #990000;
	background-color: #990000;
}
.virus-spread-10000-99999 {
	fill: #660000;
	background-color: #660000;
}
.virus-spread-100000-999999 {
	fill: #330000;
	background-color: #330000;
}
.virus-spread-1M {
	fill: #000000;
	background-color: #000000;
}
#cruise-liner:hover {
	fill: #333333;
}
.hidden-object {
	visibility: hidden;
}
.ascending {
	display: inline-block !important;
}
.descending {
	display: inline-block !important;
}
#table-wrapper * { /*CSS Reset*/
	margin-bottom: 0;
}
#table-wrapper {
	margin-left: 0%;
	/* width: 90%; */
	/* border: #00ff00 solid 2px; */
	/* height: 0; */
	/* visibility: hidden !important; */
}
.inf {
	min-width: 100px !important;
	border: 0;
	border-top: 0px !important;
	border-bottom: 0px !important;
	border-left: 0px !important;
	border-right: 0px !important;
}
#COVID19-table-Ukraine .fltrow td {
	border-bottom: 0px !important;
}
#COVID19-table-Ukraine {
	padding: 0;
	font-family: Rubik, sans-serif;
	width: 310px !important;
}
#COVID19-table-Ukraine th {
	text-align: center;
	font-size: 14px;
	border: 0;
	padding: 0;
}
#COVID19-table-Ukraine td:nth-child(1) {
	text-align: left;
	padding-left: 5px;
	border: 0;
}
#COVID19-table-Ukraine th:nth-child(2), #COVID19-table-Ukraine td:nth-child(2) {
	text-align: center;
	border: 0;
	padding: 0;
	font-size: 12px;
}
#COVID19-table-Ukraine tr:nth-child(even) {
	background: rgba(201, 201, 201, 0.2);
}
#COVID19-table-Ukraine td:nth-child(2)::first-line {
	font-size: 14px;
}
#COVID19-table-Ukraine th:nth-child(3), #COVID19-table-Ukraine td:nth-child(3) {
	text-align: center;
	background: rgba(255, 153, 153, 0.1);
	border: 0;
	padding: 0;
	font-size: 12px;
}
#COVID19-table-Ukraine td:nth-child(3)::first-line {
	font-size: 14px;
}
#COVID19-table-Ukraine th:nth-child(4), #COVID19-table-Ukraine td:nth-child(4) {
	text-align: center;
	border: 0;
	padding: 0;
	font-size: 12px;
}
#COVID19-table-Ukraine td:nth-child(4)::first-line {
	font-size: 14px;
}
#COVID19-table-Ukraine th:nth-child(5), #COVID19-table-Ukraine td:nth-child(5) {
	text-align: center;
	background: rgba(204, 204, 204, 0.1);
	border: 0;
	padding: 0;
	font-size: 12px;
}
#COVID19-table-Ukraine td:nth-child(5)::first-line {
	font-size: 14px;
}

#date-picker-div {
	/* display: none; */
	display: inline-block;
}
#date-picker-label {
	font-family: Rubik, sans-serif;
	font-size: 14px;
}
#date-picker:after {
	font-family: "Font Awesome 5 Free";
	font-weight: 900;
	content: "\f073";
	color: #555;
	padding: 0 5px;
}
#date-picker:hover:after {
	color: #E30613;
}
#date-picker {
	position: relative;
	cursor: pointer;
	margin-left: 4px;
	/* opacity: 1; */
}
#date-picker::-webkit-calendar-picker-indicator {
	position: absolute;
	width: 100%;
	height: 100%;
	opacity: 0;
}
#date-picker::-webkit-inner-spin-button {
	-webkit-appearance: none;
	display: none;
}
#date-picker:focus {
	outline: 0; /* !important; */
	}
#date-picker:required {
	box-shadow: none;
}
#backward-history:hover {
	color: #E30613;
}
#forward-history:hover {
	color: #E30613;
}
#play-history {
	margin-left: 4px;
}
#play-history:hover {
	color: #E30613;
}
#pause-history {
	margin-left: 4px;
	display: none;
}
#pause-history:hover {
	color: #E30613;
}

@media screen and (max-width: 380px) {
	.legend {
		margin-right: 8px;
		max-width: 100px;
	}
	#tooltip {
		max-width: 6em;
		line-height: 0.6;
		padding: 0px 3px 3px 3px;
		box-shadow: 0 0 0 1px #ffffff;
		/* background-color: lightgreen; */
	}
	#country-name {
		font-size: 7px;
	}
	#info-div {
		margin-top: 5px;
		font-size: 8px;
		line-height: 1.2;
	}
	.svgicon {
		height: 7px;
		margin-right: 2px;
	}
	#table-wrapper {
		margin-left: -3%;
	}
	#date-picker-label {
	display: block;
}

}

</style>

</head>

	month = '' + (d.getMonth() + 1),
	day = '' + d.getDate(),
	year = d.getFullYear();

	if (month.length < 2)
		month = '0' + month;
	if (day.length < 2)
		day = '0' + day;

	return [year, month, day].join('-');
}

countries.forEach(el => el.addEventListener('mouseover', countryHover));
countries.forEach(el => el.addEventListener('mouseout', countryOut));

function countryHover() {
	objToolTip.classList.add('active');

	document.getElementById('info-div').style.display = 'block';
	document.getElementById('recovered-info-div').style.display = 'block';
	document.getElementById('dead-info-div').style.display = 'block';

	document.getElementById('country-name').textContent=this.getAttribute(localizationPreset); //localisation preset
	if (this.classList.contains('oblast')) {
	document.getElementById('country-name').innerHTML += '<br>'+localizationOblast;
	}
	document.getElementById('suspect-span').textContent=(this.dataset.suspectCount);
	document.getElementById('sick-span').textContent=(this.dataset.sickCount);
	document.getElementById('recovered-span').textContent=(this.dataset.recoveredCount);
	document.getElementById('dead-span').textContent=(this.dataset.deadCount);

	// Disable info numbers for some classes
	// if (this.classList.contains('virus-suspect-1-9')) {
	// 	document.getElementById('info-div').style.display = 'none';
	// }
	if (this.classList.contains('hospital')) {
		document.getElementById('recovered-info-div').style.display = 'none';
		document.getElementById('dead-info-div').style.display = 'none';
	}
};

function countryOut() {
	objToolTip.classList.remove('active');
}

document.getElementById('map-Ukraine').onmousemove = function(e) {

	let rect = this.getBoundingClientRect();

	// console.log('e.pageX='+e.pageX);
	let tooltipDiv = document.getElementById('tooltip');
	let positionInfo = tooltipDiv.getBoundingClientRect();
	let tooltipWidth = positionInfo.width;

	// Tooltip X coord calculation
	if ((e.pageX - tooltipWidth/2) < 0) {
	// console.log('out of LEFT border !');
	objToolTip.style.left = parseInt(e.pageX + (tooltipWidth/2 - e.pageX)) + 'px';
	} else {
	objToolTip.style.left = parseInt(e.pageX) + 'px';
	}

	// Tooltip Y coord calculation
	if (window.matchMedia('(max-width: 380px)').matches) {
	// console.log('me small <380');
	objToolTip.style.top = parseInt(e.pageY - 25) + 'px';
	} else { 
	// // console.log('me large');
	objToolTip.style.top = parseInt(e.pageY + 25) + 'px';
	};
};
